import React from "react";
import Footer from "../components/Footer";

const Contacts = () => {
  return (
    <div className="flex flex-col min-h-screen bg-blue-100">

      {/* Main Content */}
      <div className="flex-grow">
        <h1 className="text-3xl font-bold text-center mt-8 mb-4 libre-baskerville-bold">
          Contact Us
        </h1>
        <div className="flex flex-wrap items-center justify-center m-4 space-x-4">

          {/* Contact Card */}
          <div className="max-w-sm bg-white rounded-lg shadow-lg overflow-hidden p-6">
            <h2 className="text-xl font-semibold mb-2">Our Contact Information</h2>
            <p className="text-gray-600">Address: Your College Address Here</p>
            <p className="text-gray-600">Phone: +1 234 567 890</p>
            <p className="text-gray-600">Email: contact@yourcollege.edu</p>
          </div>

          {/* Google Maps Embed */}
          <div className="w-full sm:w-auto border-2 border-gray-200 shadow-lg rounded-2xl overflow-hidden">
            <iframe
              src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3603.263492502276!2d81.76757767485836!3d25.429452922255333!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x399acda4892cc187%3A0xb07e2e87ab51e82a!2sIndian%20Institute%20of%20Information%20Technology%2C%20Allahabad!5e0!3m2!1sen!2sin!4v1730668542629!5m2!1sen!2sin"
              width="500"
              height="300"
              style={{ border: 0 }}
              allowFullScreen=""
              loading="lazy"
              referrerPolicy="no-referrer-when-downgrade"
              title="College Location on Google Maps"
            ></iframe>
          </div>
        </div>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default Contacts;
